import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Message from './components/Message'
import Login from './components/Login'
import Tracking from './components/Tracking'
import Subscribe from './components/Subscribe'
import reportWebVitals from './reportWebVitals';

const rootElement = document.getElementById('root');
const root = ReactDOM.createRoot(rootElement);
root.render(<App />);

const rootMessageElement = document.getElementById('rootMessage');
const rootMessage = ReactDOM.createRoot(rootMessageElement);
rootMessage.render(<Message />);

const rootLoginElement = document.getElementById('rootLogin');
const rootLogin = ReactDOM.createRoot(rootLoginElement);
rootLogin.render(<Login />);

const rootSubscribeElement = document.getElementById('rootSubscribe');
const rootSubscribe = ReactDOM.createRoot(rootSubscribeElement);
rootSubscribe.render(<Subscribe />);

const rootTrackingElement = document.getElementById('rootTracking');
const rootTracking = ReactDOM.createRoot(rootTrackingElement);
rootTracking.render(<Tracking />);

reportWebVitals();
